Wolf comes home from work to find his kid sister's friend Megan hanging out. He is really bummed, because his boss is really riding him and he hates his bullshit job. Megan is there to listen to him rant, and she hates to see Wolf so depressed. He needs a pick-me-up, and Megan knows EXACTLY what will get the job done.
